                    }
                        <input
                            style={{marginLeft: 5, width: "100%"}}
                            type={"text"}
                            defaultValue={DataUkrPoshta.zipcode !== "" ? DataUkrPoshta.zipcode : ""}
                            onChange={(event) =>  addDataUkrPoshta({zipcode: event.target.value})}
                        />
                    </div>
                </>
