                            <input
                                style={{marginLeft: 5, width: "100%"}}
                                type={"text"}
                                defaultValue={DataNovaPoshta.viddil !== "" ? DataNovaPoshta.viddil : ""}
                                onChange={(event) =>  addDataNovaPoshta({viddil: event.target.value})}
                            />
                        </div>

                        {visible &&
                            <>
                                <div style={{display: "flex", justifyContent: "right"}}>
                                    Місто/село: {DataNovaPoshta.city !== ""
