                                    <input
                                        style={{marginLeft: 5, width: "100%"}}
                                        type={"text"}
                                        defaultValue={DataNovaPoshta.number !== "" ? DataNovaPoshta.number : ""}
                                        onChange={(event) =>  addDataNovaPoshta({number: event.target.value})}
                                    />
